TLDR; Things Completed: Most methods in the API caller class have been implemented. George has finished the redesign of the main meal card Issues: Errors being returned from try/catch blocks are not being displayed correctly in the front end Solution: Using promises ensures that errors are caught and can be returned so they can be shown on the screen. We implemented all of the main back end functionality into the front end. Images and text are all displayed correctly. The main issue we have run into is errors from Cognito not being displayed properly when returned via a try/catch async block. We found the solution to this was using a promise. Here is an example of the before and after: //BEFORE
async signIn(username, password) { try { const user = await Auth.signIn(username, password); return user; } catch (error) { console.log("error signing in", error); return 0; }
}
//AFTER
async signIn(username, password) { return new Promise(async (resolve, reject) => { try { const user = await Auth.signIn(username, password); resolve(user); } catch (error) { reject(error); } });
} Rejecting the error via a promise allows us to display the error message on screen along with red outlining of the text input box where there was an error.
